import './App.css';
import  styled from "styled-components";

const Wrapper=styled.div`
width:200px;
height:300px;
border:4px solid red;
`;

const Ptag=styled.p`
background:red;
`;

const Title = styled.title`
  font-size: 2rem;
  color: #333;
`;

function App() {
  return (
    <div  className="App">
  <Wrapper>
<div>Hello</div>
  </Wrapper>
  <Ptag>
    <p>Lorem ipsum dolor sit.</p>
  </Ptag>
  <Title>
    <h2>Lorem, ipsum.</h2>
  </Title>
    </div>
  );
}

export default App;
